tinymce.PluginManager.add("sp_wpcp_mce_button",function(t,e){t.addButton("sp_wpcp_mce_button",{text:!1,icon:!1,image:e+"/icon32.png",tooltip:"WP Carousel Pro",onclick:function(){t.windowManager.open({title:"Insert Shortcode",width:400,height:100,body:[{type:"listbox",name:"listboxName",label:"Select Carousel",values:t.settings.spWPCPCarouselList}],onsubmit:function(e){t.insertContent('[sp_wpcarousel id="'+e.data.listboxName+'"]')}})}})});